define('facets_about_us.tpl', [
    'Handlebars',
    'Handlebars.CompilerNameLookup'
], function (Handlebars, compilerNameLookup) {
    var template = Handlebars.template({
        'compiler': [
            7,
            '>= 4.0.0'
        ],
        'main': function (container, depth0, helpers, partials, data) {
            return '<style> li.listabout {\nclear: both;\nlist-style-type:circle !important;\nfloat: left;\nlist-style-position: inside;\npadding-bottom: 15px;\n}\n\n.linejump{\n  padding-top:10px;\n  text-align: justify;\ntext-justify: inter-word;\n} </style><div class="container" style="margin-top:-65px;"><div class="col-xs-12 col-sm-12 col-md-12 col-lg-12"  style="border: 1px solid black;"><p class="linejump">Since 1944, we have sold wholesale gift and novelty products into retail markets across the country, from the world\'s largest retailer to the smallest mom and pop shop.</p><br><ul><li class="listabout">Your one stop sports shop for everything fans need to accessorize their vehicle, have a tailgate party, decorate their room or office, and get as a gift.</li><li class="listabout">Consistently top-ranked licensee of the NFL, MLB, NBA, NHL and more than 200 colleges and universities.</li><li class="listabout">Acquired Tag Express in 2001, and Big League Promotions and Tags By Design in 2009.</li><li class="listabout">Manufacturing and distribution facilities in Niles, IL, and Heath Springs, SC.</li><li class="listabout">More than 90% of items made or finished in the United States.</li></ul></div></div><br><div class="container" ><div class="col-xs-12 col-sm-12 col-md-12 col-lg-12"  style="border: 1px solid black; background-color:#cd163f;"><p style="font-size:1.73rem; color:white;">Trust</p></div><div class="col-xs-12 col-sm-12 col-md-12 col-lg-12"  style="border-right: 1px solid black; border-left: 1px solid black; border-bottom: 1px solid black;"><p class="linejump"> It\u2019s not a word used lightly these days. But over the last 75 years, Rico Industries has earned an unparalleled reputation for trust and integrity among its customers, vendors, and industry peers. </p><p class="linejump"> Founded in May 1944 by three immigrant relatives, Rico Industries began manufacturing wallets from scrap leather. The second generation continued this tradition of hard work and excellent service as Rico became the top supplier of private label wallets to various major retailers in the U.S.A. Its reputation as a vendor led those customers to ask Rico to distribute other\n      companies\u2019 products, including many sports licensees \u2013 which Rico had also become in 1984 \u2013 continuing as the third generation began to operate the family business. </p><p class="linejump"> Rico bought one of those other companies in 2000, Tag Express, improving on its delivery and service to become one of the top hardgood licensees for the NFL, MLB, NBA, NHL, and many colleges and universities.  As the fourth generation joined the business, the company grew with two more acquisitions in 2009 \u2013 Big League Promotions and Tags By Design. In 2013 Rico launched its first brand, SPARO, starting with a line of fashionable sports-licensed watches. </p><p class="linejump"> Poised for continued growth in the years ahead, Rico Industries has kept and will always keep those values it started with \u2013 telling the truth, seeing a job through to the end, keeping its promises \u2013 close to heart. </p><p class="linejump"> Thank you for your business. </p><p class="linejump"> Sincerely, </p><p class="linejump"> The Rico Industries Team. </p><br></div></div><br><div class="container" ><div class="col-xs-12 col-sm-12 col-md-12 col-lg-12"  style="border: 1px solid black; "><p class="linejump"> If you have a Retail Sales Tax ID, contact us at info@ricoinc.com for more information or to place an order. </p><br></div></div> ';
        },
        'useData': true
    });
    template.Name = 'facets_about_us';
    return template;
});
